import React from 'react';
import './App.css';

async function Home() {
    React.useEffect(() => {
        fetchItems();
    }, []);

    const fetchItems = async () => {
        const data = await fetch("/");
        const json = await data.json();
        console.log(json);
    }

    return (
        <div>
            <h1>Home Page</h1>
        </div>
    );
}

export default Home;
